import React from "react";
import {Container , Row , Col} from "reactstrap";

export default class Categories extends React.Component{
    constructor(props){
        super(props);
    }
    render(){
        return <section className="categories">
            <Container>
                <Row>
                    <Col className="d-flex flex-column">
                    </Col>
                    <Col className="d-flex flex-column">
                    </Col>
                </Row>
            </Container>
        </section>
    }
}
